// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/utils/Counters.sol";
import "./VehicleRegistrationToken.sol";
import "./VehicleMetadata.sol";

contract VehicleMarket is VehicleMetadata {
    using Counters for Counters.Counter;

    Counters.Counter private _saleTicketsIds;

    mapping(uint256 => bool) _isVehicleOnSale;
    mapping(uint256 => SaleTicket) _idToSaleTicket;
    mapping(uint256 => uint256[]) _vehicleToSaleTicketIds;
    uint256[] _listedVehiclesIds;

    VehicleRegistrationToken vrt;

    constructor(address VRTAddress) {
        vrt = VehicleRegistrationToken(VRTAddress);
    }

    struct SaleInfo {
        VehicleToken token;
        uint256 price;
    }

    struct SaleTicket {
        uint256 price;
        uint256 outTimestamp;
        bool out;
    }

    function listedItemsCount() public view returns (uint256) {
        return _listedVehiclesIds.length;
    }

    function isVehicleOnSale(uint256 tokenId) public view returns (bool) {
        return _isVehicleOnSale[tokenId];
    }

    function getVehicleSaleTickets(uint256 tokenId)
        public
        view
        returns (SaleTicket[] memory)
    {
        uint256[] memory vehicleSaleTicketsIds = _vehicleToSaleTicketIds[
            tokenId
        ];
        SaleTicket[] memory items = new SaleTicket[](
            vehicleSaleTicketsIds.length
        );
        for (uint256 i = 0; i < vehicleSaleTicketsIds.length; i++) {
            uint256 ticketId = vehicleSaleTicketsIds[i];
            items[i] = _idToSaleTicket[ticketId];
        }
        return items;
    }

    function getLastVehicleSaleTicketId(uint256 tokenId)
        public
        view
        returns (uint256)
    {
        uint256[] memory vehicleSaleTickets = _vehicleToSaleTicketIds[tokenId];
        require(
            vehicleSaleTickets.length > 0,
            "Vehicle is never be placed on sale"
        );
        return vehicleSaleTickets[vehicleSaleTickets.length - 1];
    }

    function getAllNftsOnSale() public view returns (SaleInfo[] memory) {
        SaleInfo[] memory items = new SaleInfo[](_listedVehiclesIds.length);
        for (uint256 i = 0; i < _listedVehiclesIds.length; i++) {
            uint256 tokenId = _listedVehiclesIds[i];
            VehicleToken memory item = vrt.getVehicleToken(tokenId);
            uint256 itemPrice = _idToSaleTicket[
                getLastVehicleSaleTicketId(tokenId)
            ].price;
            items[i] = SaleInfo({token: item, price: itemPrice});
        }
        return items;
    }

    function buyNft(uint256 tokenId) public payable {
        require(_isVehicleOnSale[tokenId], "The vehicle is not on sale");
        SaleTicket storage saleTicket = _idToSaleTicket[
            getLastVehicleSaleTicketId(tokenId)
        ];
        uint256 price = saleTicket.price;
        address owner = vrt.ownerOf(tokenId);
        require(msg.sender != owner, "You already own this NFT");
        require(msg.value == price, "Please submit the asking price");
        saleTicket.out = true;
        saleTicket.outTimestamp = block.timestamp;
        _removeVehicleOnSale(tokenId);
        vrt.transferFrom(owner, msg.sender, tokenId);
        payable(owner).transfer(msg.value);
    }

    function placeNftOnSale(uint256 tokenId, uint256 newPrice) public payable {
        require(
            vrt.ownerOf(tokenId) == msg.sender,
            "You are not owner of this nft"
        );
        require(!_isVehicleOnSale[tokenId], "Item is already on sale");
        _saleTicketsIds.increment();
        _idToSaleTicket[_saleTicketsIds.current()] = SaleTicket(
            newPrice,
            0,
            false
        );
        _vehicleToSaleTicketIds[tokenId].push(_saleTicketsIds.current());
        _listedVehiclesIds.push(tokenId);
        _isVehicleOnSale[tokenId] = true;
    }

    function removeNftOnSale(uint256 tokenId) public {
        require(
            vrt.ownerOf(tokenId) == msg.sender,
            "You are not owner of this nft"
        );
        require(_isVehicleOnSale[tokenId], "Item is already on sale");
        _removeVehicleOnSale(tokenId);
        _vehicleToSaleTicketIds[tokenId].pop();
    }

    function _removeVehicleOnSale(uint256 tokenId) private {
        require(_isVehicleOnSale[tokenId]);
        uint256 vehicleIdIndex = 0;
        for (uint256 i = 0; i < _listedVehiclesIds.length; i++) {
            if (_listedVehiclesIds[i] == tokenId) {
                vehicleIdIndex = i;
            }
        }
        for (
            uint256 i = vehicleIdIndex;
            i < _listedVehiclesIds.length - 1;
            i++
        ) {
            _listedVehiclesIds[i] = _listedVehiclesIds[i + 1];
        }
        _listedVehiclesIds.pop();
        _isVehicleOnSale[tokenId] = false;
    }
}
